// ApiBc49.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Table } from 'react-bootstrap'
import '../App.css'

const ApiNumbers = ({ endpoint }) => {
    const [data, setData] = useState([]);

    useEffect(() => {
        // Fetch data from the specified endpoint
        axios.get(endpoint)
            .then(response => {
                setData(response.data.data);
            })
            .catch(error => {
                console.error('Error fetching data:', error);
            });
    }, [endpoint]);

    const getHeader = () => {
        return (
            <tr>
                {data.map(item => (
                    <th ey={item.Value} className="text-light bg-info">{item.Value}</th>
                ))}
            </tr>
        )
    }

    return (
        <div className="card">
            <span className='App-link'>{endpoint}</span>
            <Table responsive className="table-default mb-4" size="sm" hover="true">
                <thead className="table-danger text-center"> {getHeader()} </thead>
                <tbody >
                    {data.map(item => (
                        <td key={item.Value} className="text-warning bg-primary">{item.Value}({item.Distance}, {item.IsHit === true ? 1 : 0}, {item.NumberOfDrawsWhenHit}, {item.IsBonusNumber === true ? 1 : 0}, {item.TotalHits})</td>
                    ))}
                </tbody>
                <thead className="table-danger text-center"> {getHeader()} </thead>
            </Table>
        </div>
    )
}

export default ApiNumbers
